import React from "react";
import axios from "axios";
import { useEffect, useState } from "react";
import { Form, Button, Table } from "react-bootstrap";
import dinoLogo from "../auth/images/dinoLogo.png";
import bg from "../auth/images/bg9.jpg";
import "../css/table.css";
import "../css/profile.css";
import jwt from "jsonwebtoken";
import { useParams } from 'react-router-dom';

const RestaurantProfile = () => {
    const params = useParams();
    console.log(params);
    const id=params.id;
    const [initialState, setInitialState] = useState([]);

    useEffect(() => {
        fetch(`/post/${id}`).then(res => {
            return res.json();
        }).then(jsonResponse => setInitialState(jsonResponse));
    }, []);
    console.log(initialState);
    return ( 
        <div className="background">
      {/* <Navbar2 /> */}
      <img className="bg2" src={bg} />
      <a href="/" className="navlogo">
        {/* <div data-aos="fade-right" className="fade"> */}
          <img className="dinologo" src={dinoLogo} />
        {/* </div> */}
      </a>

      <div className="links2">
        <a href="/SignUp">Sign Up</a>
        <a href="/LogIn">Sign In</a>
        <a href="/Profile">Profile</a>
      </div>

      <div className="profile4">
        {/* <div data-aos="zoom-in-up" className="fade"> */}
          <div className="justify-content-md-center">
          
          
        <h1 id="rname">Welcome To {initialState.name}</h1>
        <h1 id="rname">{initialState.cuisine}</h1>
        <h1 id="rname">{initialState.location}</h1>
        <h1 id="rname">{initialState.rating}</h1>
        </div>
        </div>
        <div className="interior" id="interior">
                            <h1>Interior</h1>
                            <br />
                            <Carousel>
                                <Carousel.Item><img className="restaurant-interior" src={dine} /></Carousel.Item> <Carousel.Item><img className="restaurant-interior" src={dine3} /></Carousel.Item> <Carousel.Item><img className="restaurant-interior" src={dine4} /></Carousel.Item>
                            </Carousel>
                        </div>
        
          </div>
     );
}
 
export default RestaurantProfile;
